import React from 'react'
import StatusCard from './statusCard'

const StatusList = ({listID,listTitle, cards}) =>
{
  
    return (
        <div>
            <div>{listTitle}</div>
        {/* <div>
       {cards.map(card => (<StatusCard key={card.cardID} title={card.title} buttons={card.buttons}/> ))} 
       </div> */}
        </div>
    )
}

export default StatusList;
